import * as S from './title.styles';
import * as GS from '../../styles/global';

export default function Title() {
	return (
		<>
			<GS.FlexEven>
				<div>
					<h2>Title</h2>
				</div>
				<div style={{ textAlign: 'right' }}>Read More</div>
			</GS.FlexEven>
			<GS.HR />
		</>
	);
}
